export default function Chats(props) {
    // fetch a list of the people in a course
    const [data, setData] = useState([]);

    useEffect(() => {
      fetch("./classSpecificPeople.json")
        .then((res) => res.json())
        .then((data) => {
          setData(data.people); //change the state and re-render
        });
    }, []);

  return (
    <div>
      <div className="students">Your chat history</div>
      <div className="col-9">
        <div className="card">
          <div className="card-body">
            <h5 className="card-title">Louis Ta</h5>
          </div>
        </div>
      </div>

      <div className="col-9">
        <div className="card">
          <div className="card-body">
            <h5 className="card-title">YuYu Madigan</h5>
          </div>
        </div>
      </div>
    </div>
  );
}
